      out.write("<script>\r\n");
      out.write("    function transferTime(cTime) {     //将json串的一串数字进行解析\r\n");
      out.write("        var jsonDate = new Date(parseInt(cTime));\r\n");
      out.write("        //       alert(jsonDate);\r\n");
      out.write("        //为Date对象添加一个新属性，主要是将解析到的时间数据转换为我们熟悉的“yyyy-MM-dd hh:mm:ss”样式\r\n");
      out.write("        Date.prototype.format = function (format) {\r\n");
      out.write("            var o = {\r\n");
      out.write("                //获得解析出来数据的相应信息，可参考js官方文档里面Date对象所具备的方法\r\n");
      out.write("                \"y+\": this.getFullYear(), //得到对应的年信息\r\n");
      out.write("                \"M+\": this.getMonth() + 1, //得到对应的月信息，得到的数字范围是0~11，所以要加一\r\n");
      out.write("                \"d+\": this.getDate(), //得到对应的日信息\r\n");
      out.write("                \"h+\": this.getHours(), //得到对应的小时信息\r\n");
      out.write("                \"m+\": this.getMinutes(), //得到对应的分钟信息\r\n");
      out.write("                \"s+\": this.getSeconds(), //得到对应的秒信息\r\n");
      out.write("            }\r\n");
      out.write("            //将年转换为完整的年形式\r\n");
      out.write("            if (/(y+)/.test(format)) {\r\n");
      out.write("                format = format.replace(RegExp.$1, (this.getFullYear() + \"\").substr(4 - RegExp.$1.length));\r\n");
      out.write("            }\r\n");
